import React from "react";
import { ScrollContainer, ScrollPage } from 'react-scroll-motion'
import headerImage from '../../img/header-image.gif'

const Home = () => {
    return (
        <ScrollContainer>
            <ScrollPage page={0}>
                <div className="image-container">
                    <img src={headerImage} alt='girl'/>
                </div>
            </ScrollPage>
        </ScrollContainer>
    )
}

export default Home;
